// variables
const categoryDOM = document.querySelector(".category-center")
const btnDOM = document.querySelector(".btn-center")




document.addEventListener("DOMContentLoaded", () => {
  displayCategories(catlog)

});

function displayCategories(menuItems) {
  let displayCategory = menuItems.map(function (item) {
    //console.log(item)
    return `<div class="category-tile-grid" data-id="${item.categoryName}">
    <img src="${item.categoryImage}" alt="${item.categoryName}">
    <button class="filter-btn" data-id="${item.categoryName}">
    <h2>${item.categoryName}</h2>
    </button>
    </div>`;
  });
  displayCategory = displayCategory.join("");
  console.log(displayCategory);
  categoryDOM.innerHTML = displayCategory;

  //   function displayBtns(menuItems) {
  //   let displayBtn = menuItems.map(function (item) {
  //     //console.log(item)
  //     return `<button class="filter-btn" data-id="${item.categoryName}">
  //         <h2>${item.categoryName}</h2>
  //         </button>`;
  //   });
  //   displayBtn = displayBtn.join("");
  //   console.log(displayBtn);
  //   btnDOM.innerHTML = displayBtn;
  // }


  const filterBtns = document.querySelectorAll(".filter-btn")

  //filteritems

  filterBtns.forEach(function (btn) {
    btn.addEventListener("click", function (e) {
      const category = e.currentTarget.dataset.id;
      const menuCategory = subCategories.filter(function (menuItem) {
        if (menuItem.category.toLowerCase() === category.toLowerCase()) {
          return menuItem
        }
      })
      console.log(menuCategory);
      displaySubCategories(menuCategory)
      // displayBtns(catlog)

    });
  });
}

function displaySubCategories(menuItems) {
  let displayCategory = menuItems.map(function (item) {
    //console.log(item)
    return `<div class="category-tile-grid" data-id="${item.categoryName}">
        <img src="${item.categoryImage}" alt="${item.categoryName}">
        <button class="filter-btn01" data-id="${item.categoryName}">
        <h2>${item.categoryName}</h2>
        </button>
        </div>`;
  });
  displayCategory = displayCategory.join("");
  console.log(displayCategory);
  categoryDOM.innerHTML = displayCategory;

  const filterBtns01 = document.querySelectorAll(".filter-btn01")

  //filteritems

  filterBtns01.forEach(function (btn) {
    btn.addEventListener("click", function (e) {
      const category = e.currentTarget.dataset.id;
      const menuCategory = products.filter(function (menuItem) {
        if (menuItem.subCategory.toLowerCase() === category.toLowerCase()) {
          return menuItem
        }
      });

      console.log(menuCategory);
      displayproducts(menuCategory);
    });
  });
}

// displaying products
function displayproducts(products) {

  let displayProduct = products.map((item) => {
    return `<div class="product-tile-grid">
    <div class="img">
   <img src="${item.img}" alt="${item.tittle}">
   </div>
   <p>${item.tittle.toLowerCase()}</p>
   <div class="thumb">
   <div class="current-price">
    <h1>${item.price.slice(0,-2)}${"."}${item.price.slice(-2)}</h1>
    </div>
    <img src="../images/add-to-shopping-list.png" alt="">
    </div>
    <button class="add-to-cart">
    <h1>add to cart <span><img src="../images/add-to-cart.png" alt=""></span></h1>
    </button>
    </div>`
  });
  let displayproduct = displayProduct.join("");
  // console.log(displayCategory);
  categoryDOM.innerHTML = displayproduct;


}